import React, { useState, useEffect } from "react";

const Home = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = () => {
    fetch("https://www.themealdb.com/api/json/v1/1/filter.php?c=Seafood")
      .then((response) => response.json())
      .then((responseData) => {
        // Check if responseData.meals is an array
        if (Array.isArray(responseData.meals)) {
          setData(responseData.meals);
        } else {
            //set it to empty array
          setData([]);
        }
      })
      .catch((error) => console.error("Error fetching data: ", error));
  };

  return (
    <div>
      <h1>Meal Page</h1>
      <ul>
        {data.map((item, index) => (
          <li key={index}>{item.strMeal}</li>
        ))}
      </ul>
    </div>
  );
};

export default Home;
